import React from 'react';
import { Navlink } from 'react-router-dom'

const Navbar = () => {
    return (
        <nav class="navbar navbar-dark bg-primary mb-3">
            <div class="container">
                <Navlink class="navbar-brand" href="/">WikiCountries</Navlink>
            </div>
        </nav>
    )
}

export default Navbar
